                this.array.push({tip:"text",value:aa[i].aText[1],       size:size, bx:70, by:dSY+yyySah,  boolNext:false})
                this.array.push({tip:"text",value:aa[i].aText[2],       size:size, bx:70, by:dSY+yyySah*2,  boolNext:false})
                this.array.push({tip:"text",value:aa[i].aText[3]+" "+dcmParam.tCInfa.getText(1),   size:size, bx:70, by:dSY+yyySah*3,  boolNext:false})
                this.array.push({tip:"text",value:aa[i].aText[4],       size:size, bx:70, by:dSY+yyySah*4,  boolNext:false}) 
